INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('哈尔滨八旗满族服饰博物馆','满族是我省少数民族分布最广、人数最多的民族。黑龙江是满族的祖先女真人的萌生地，白山黑水是他的故乡。至今我们使用许多方言及地名、生活习俗、饮食习惯来源于满语和满族人的习俗','非国有','1.26962504298e+002','4.54953253036e+001','黑龙江省哈尔滨市','市','1','0101000020E61000009C20A0AB99BD5F40F2FDCDD166BF4640');
