INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('长江文明馆','长江文明馆位于武汉园博园的核心位置，于2013年11月13日破土动工，2015年9月25日落成运行，是集中收藏、展示、科普和研究长江自然生态与历史文明的综合性博物馆，已经国家文物行政部门备','文物','1.14216257486e+002','3.06254175356e+001','四川省宜宾市宜宾县长江','乡镇','1','0101000020E6100000D2F0A329D78D5C4009EE155D1BA03E40');
