INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('诸暨市博物馆','诸暨市博物馆是一座反映诸暨地方历史的综合性博物馆，毗邻城市广场，占地20余亩，建筑面积4200平方米。博物馆于1998年10月8日建成开放，2004年5月1日起对公众实行免费开放。博物馆现有文物','文物','1.20241414816e+002','2.97109926466e+001','浙江省绍兴市诸暨市诸暨博物馆','兴趣点','1','0101000020E61000007C7A2057730F5E4085AD349D03B63D40');
INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('禹州中医药文化博物馆','禹州市中医药文化博物馆是河南省唯一的集古代建筑、文物为一体综合性博物馆。禹州市中医药文化博物馆依托十三帮会馆和怀帮会馆而建，位于禹州市城西北文卫路中段，中医药文化博物馆','文物','1.13482225805e+002','3.41479524626e+001','河南省许昌市禹州市禹州','兴趣点','0','0101000020E6100000EB2D9FC9DC5E5C40C432361BF0124140');
INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('长沙玉和醋文化博物馆','玉和酱园系由苏州酿造技师董玉和创建于清朝顺治六年（公元1649），原址位于古城潭州小西门正街（即现长沙坡子街202号）。玉和酱园以玉醋驰名，玉醋以其浓、香、醇、鲜四大特点并兼具调','非国有','1.19474293014e+002','3.21057428939e+001','湖南省长沙市天心区醋文化博物馆','兴趣点','1','0101000020E61000005D2216D15ADE5D407775AFFB880D4040');
