INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('民族文化宫博物馆','民族文化宫座落在北京长安街西侧，建于1959年9月，是中华人民共和国成立十周年首都北京著名的十大建筑之一。\n    民族文化宫是国家民族事务委员会直属的文化事业单位。内设展览馆、中国','行业','1.16362799174e+002','3.99067177453e+001','湖北省武汉市江汉区民族街道','乡镇','1','0101000020E6100000B103071A38175D408856BB530FF44340');
INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('黔西南州博物馆','黔西南州古代文物精品展展出的文物涵盖了前夜郎、夜郎、后夜郎三个时期，展览共计展出黔西南州这三个时期的出土文物128件套，其中一级文物32件套，二级文物13件套，三级文物20件套。','文物','1.05466002179e+002','2.51091338242e+001','贵州省黔西南布依族苗族自治州兴义市黔西南州博物馆','兴趣点','1','0101000020E6100000A00CCEFAD25D5A402FC7BD31F01B3940');
