INSERT INTO "museum" ("instname","summary","museumprop","log","lat","formatted_","level","exact",geom) VALUES ('双星鞋文化博物馆','双星鞋文化博物馆位于青岛市市南区贵州路5号，于2011年正式对外开放。展厅面积达2000平方米。\n双星文化城以图片、文字、实物为载体，揭示了制鞋工艺的演变历史；展示了双星集团由制鞋转','行业','1.06359298263e+002','3.03443103062e+001','四川省广安市武胜县双星乡','乡镇','0','0101000020E61000007E8124BEFE965A402CC660B824583E40');
